function Main() {

    return ( 

        <section className="profile">
        <div className="profile__avatar-cover">
            <button className="profile__cover-hover" type="button"></button>
            <img alt="Жак-Ив Кусто." src="<%=require('../src/images/image-2.jpg')%>" className="profile__avatar" />
        </div>
        <div className="profile__info-block">
            <div className="profile__title">
                <h1 className="profile__name">Жак-Ив Кусто</h1>
                <button className="profile__edit-button button" type="button"></button>
            </div>
            <p className="profile__info">Исследователь океана</p>
        </div>
        <button className="profile__add-button button" type="button"></button>
    </section>

    )

};

export default Main;
